import LogInForm from "./loginForm/loginForm"

const Screens = () => {

    
    return(
        <>
            <LogInForm onLogIn={onLogIn}/>
            <TableScreen />
        </>
    )
}

function onLogIn(login){
    if (login === true){
      setShowingLogInForm(false)
    }else {
      alert('Wrong Email or password. Try again.')
    }
    
  }

export default Screens
